// Custom LazyLoad Js

window.onload = function() {

    const options = {
        root: null,
        rootMargin: "0px 0px 200px 0px",
        threshold: 0.1,
    }

    const lazyloadImages = document.querySelectorAll(".lazy");

    new lazyload(lazyloadImages, options)



    // Lazy Loading Iframe
    const lazyloadBGIframe = document.querySelectorAll("iframe.lazy");

    console.log(lazyloadBGIframe)

    const BGIframesObserver = new IntersectionObserver(function(entries, observer) {
        entries.forEach(function(entry) {
            if (entry.isIntersecting) {
            const bgIframe = entry.target;

            bgIframe.src = bgIframe.dataset.src;
            bgIframe.classList.remove("lazy-bg");
            
            BGIframesObserver.unobserve(bgIframe);
            }
        });
        },options);

        lazyloadBGIframe.forEach(function(bgIframes) {
                BGIframesObserver.observe(bgIframes);
        });

}
